    period that were not reported. On 9/16/2009 a number of disbursements were sent
    to campaigns without signatures on the checks. The mistake was caught on 9/21/2009
    and new checks were sent along with letters of instruction not to deposit the
    unsigned checks. This amended report correctly reports those transactions. The
    refunds from the campaign committees and PACs will appear in the 2009 Year-end
    report covering December 2009 and the February 20, 2010 report covering January
    2010.\n"
